def insert_max_top10():

    num = 10 - len(datas)

    data = datas.pop(0)

    tree.insert("", num, text=str(num), values=(int(num)+1,data[0], data[1], data[2]))  # #给第0行添加数据，索引值可重复
    if(len(datas)):
        window.after(1500, insert_max_top10)

